				doc.text('Ao: ' + vehiculo.year, 10, 84);
				doc.setFontSize(15);
				doc.text('Documentacin recibida', 10, 97);
				doc.setFontSize(13);
				doc.text('Titulo: ' + this.cambioValor(vehiculo.titulo), 10, 107);
				doc.text('Cedula Verde: ' + this.cambioValor(vehiculo.cedulaVerde), 10, 114);
				doc.text('Formulario 08 Firmado: ' + this.cambioValor(vehiculo.formularioFirmado), 10, 121);
				doc.text('Verificacin Policial: ' + this.cambioValor(vehiculo.verPolicial), 10, 128);
